jQuery(document).ready(function(){if(0<$(".cd-stretchy-nav").length){var a=$(".cd-stretchy-nav");a.each(function(){var a=$(this),b=a.find(".cd-nav-trigger");b.on("click",function(b){b.preventDefault(),a.toggleClass("nav-is-visible")})}),$(document).on("click",function(b){$(b.target).is(".cd-nav-trigger")||$(b.target).is(".cd-nav-trigger span")||a.removeClass("nav-is-visible")})}});